import axios from 'axios';
import { useState, useEffect } from 'react';

export default function Videos() {
  const [videos, setVideos] = useState([]);

  useEffect(() => {
    axios({
      method: 'get',
      url: `https://www.googleapis.com/youtube/v3/playlistItems?part=snippet&maxResults=20&playlistId=UUfAdLF-Ys_mxjBUHaRRjYpA&key=${process.env.YouTube_API_KEY_V3}`,
    })
    .then((res) => {
      console.log(res.data.items[0].snippet.thumbnails.standard.url);
      setVideos(res.data.items);
    })
    .catch(error => {
      console.log(error);
    });
  }, []);


  return (
    <div className="videos">
      {videos.map( item => {
        return (
          <div>
            <h2>{item.snippet.title}</h2>
            <img src={item.snippet.thumbnails.standard.url} />
          </div>
        )
      })}
    </div>
  );
}
